// App.js
import React from "react";

import "./App.css";
import ImageOverlay from "./components/ImageOverlay";
import GoogleMap from "./components/GoogleMap";

function App() {
  return (
    <div className="app">
      <GoogleMap />
      <ImageOverlay />
    </div>
  );
}

export default App;
